import AppManager from '../app/appManager';
import {HomePageBuilder} from '../index';
import PageCodes from './pageCodes';
import HtmlEditorPage from './page/MonacoEditorDemo';
import JsonViewerPage from './page/JsonViewer';
import WysiwygEditorPage from './page/wysiwygEditor';
import CombinedEditorPage from './page/combinedEditor';
import AssetUploaderPage from './page/uploadImage';
import TablePage from './page/TableDemo';
import AlternateSourceEditorPage from './page/alternateSourceEditor';
import LoginPage from './page/login';

let appManager = new AppManager([
    HomePageBuilder.build(),
    {
        title     : 'Html editor',
        path      : '/html-editor',
        icon      : 'extension',
        inMenu    : true,
        permission: true,
        children  : [
            {
                path     : '',
                name     : PageCodes.SOURCE_EDITOR, //name in vue router
                component: HtmlEditorPage,
                title    : 'HTML editor',
            },

        ]
    },
    {
        title     : 'JSON viewer',
        path      : '/json-viewer',
        icon      : 'extension',
        inMenu    : true,
        permission: true,
        children  : [
            {
                path     : '',
                name     : PageCodes.JSON_VIEWER, //name in vue router
                component: JsonViewerPage,
                title    : 'JSON viewer',
            }

        ]
    },
    {
        title     : 'Content Editor (WYSIWYG)',
        path      : '/wysiwig-editor',
        icon      : 'extension',
        inMenu    : true,
        permission: true,
        children  : [
            {
                path     : '',
                name     : PageCodes.WYSIWYG_EDITOR, //name in vue router
                component: WysiwygEditorPage,
                title    : 'WYSIWYG Editor',
            }

        ]
    },
    {
        title     : 'Combined Editor (WYSIWYG+HTML)',
        path      : '/combined-editor',
        icon      : 'extension',
        inMenu    : true,
        permission: true,
        children  : [
            {
                path     : '',
                name     : PageCodes.COMBINED_EDITOR, //name in vue router
                component: CombinedEditorPage,
                title    : 'Combined Editor',
            }

        ]
    },
    {
        title     : 'Image uploader',
        path      : '/asset-uploader',
        icon      : 'cloud_upload',
        inMenu    : true,
        permission: true,
        children  : [
            {
                path     : '',
                name     : PageCodes.ASSET_UPLOADER, //name in vue router
                component: AssetUploaderPage,
                title    : 'Asset uploader',
            }

        ]
    },
    {
        title     : 'Table',
        path      : '/table',
        icon      : 'extension',
        inMenu    : true,
        permission: true,
        children  : [
            {
                path     : '',
                name     : PageCodes.TABLE, //name in vue router
                component: TablePage,
                title    : 'Table',
            }

        ]
    },
    {
        title     : 'Alternate source editor',
        path      : '/alternate-src-editor',
        icon      : 'extension',
        inMenu    : true,
        permission: true,
        children  : [
            {
                path     : '',
                name     : PageCodes.ALTERNATE_SOURCE_EDITOR, //name in vue router
                component: AlternateSourceEditorPage,
                title    : 'Alternate source editor',
            }

        ]
    },
    {
        title     : 'Login',
        path      : '/login',
        icon      : 'extension',
        inMenu    : true,
        permission: true,
        children  : [
            {
                path     : '',
                name     : PageCodes.LOGIN, //name in vue router
                component: LoginPage,
                title    : 'Login',
            }

        ]
    },
]);
export default appManager;
